import React from 'react'
import './App.css';
import ItemForm from './Components/ItemForm'
import { Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path='/itemform'>
          <ItemForm />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
